import React from "react";

import './style.css'

const CategoryView = ( props ) =>{
    const { data } = props
    if(data.view_type === "cells_auto_fill"){
        const { items } = data
        console.log( items )
        return(<div className="cell-top-fill">
              {
                  items.length > 0 ? ''
                //   items.map(el=> <img alt="" src={} key={el.id}/>)
                  : ''
              }
        </div>)
    }
}

export default CategoryView
